                "description": "Dnia 17 września 2020 roku miało miejsce uroczyste otwarcie Bulwarów przy ul. Henryka Sienkiewicza w Choroszczy. To inwestycja innowacyjna społecznie. Dzięki niej miejscowość Choroszcz wzbogaciła się w pierwszy skate park, a cały region w pierwszą tężnię solankową. </p><p>Dzięki realizacji projektu teren wcześniej niezagospodarowany i zdegradowany przekształcony został w nowoczesną i kolorową promenadę oferującą cały szereg atrakcji. </p><p>Znalazła się tu ciekawa infrastruktura sportowa, na którą składa się siłownia zewnętrzna oraz bogato wyposażony skate park. Niewątpliwą atrakcją, szczególnie dla najmłodszych, jest nowoczesny i bezpieczny plac zabaw. Najbardziej innowacyjnym elementem obiektu jest niewątpliwie tężnia solankowa, przy której można spocząć na ławeczkach i pooddychać pełnym prozdrowotnych właściwości powietrzem. Całość obiektu ma nową zróżnicowaną nawierzchnię, a okala ją sieć chodników, ścieżek rowerowych oraz wygodne parkingi. Dodatkowo jest tu dużo zieleni. W ramach projektu zrealizowane zostało też przyłącze i instalacja kanalizacji deszczowej oraz wodociągowej.",
