                "description": 'Dzięki realizacji projektu „Rewitalizacja starej łaźni oraz bulwarów nad rzeką Czarna Hańcza w Suwałkach” i wsparciu środków UE obszar od ul. Kościuszki do rzeki Czarna Hańcza zyskał zupełnie nowe oblicze. Projekt podzielony został na dwa zadania. Pierwsze to rewitalizacja budynku starej łaźni z przeznaczeniem budynku na  cele publiczne, a drugie to rewitalizacja z zagospodarowaniem części terenów przyległych, w celu utworzenia bulwarów nad rzeką Czarna Hańcza.</p><p>W ramach zadania drugiego zagospodarowane zostały tereny nadrzeczne: wykonano chodniki, ścieżki rowerowe, liczne nasadzenia zieleni (trawniki, łąki kwietne) z elementami małej architektury, a także oświetlenie z iluminacją oraz liniami zasilającymi. Prace dotyczyły też wyregulowania brzegu rzeki Czarna Hańcza wraz z umocnieniem podstawy skarp, budową nabrzeża rekreacyjnego, slipu dla kajaków oraz kładki dla pieszych i rowerzystów.</p><p>Stara Łaźnia i przestrzeń dookoła niej stały się miejscem spotkań z kulturą, koncertów plenerowych, wydarzeń ekologicznych i oświatowych, zawodów rekreacyjnych i sportowych.',
