                "description": "Budynek miejskiej łaźni w Suwałkach zbudowany został w latach trzydziestych ubiegłego wieku, ale przetrwał tylko do lat siedemdziesiątych. Później zabytkowy budynek zaczął popadać w ruinę. Teren dookoła budynku przez dziesięciolecia był terenem niewykorzystywanym, zapomnianym, który porastały chaszcze i krzaki.</p><p>Budynek Starej Łaźni został zbudowany praktycznie od nowa. Pozostawiono tylko trzy zabytkowe ściany zewnętrzne, a dzięki rozbudowie i nadbudowie budynek ma teraz prawie dwa razy większą kubaturę niż pierwotnie. Jest to teraz obiekt użyteczności publicznej z przestrzenią wystawienniczą przeznaczoną na galerię oraz na potrzeby kultury i sportu. Znalazło się też tu miejsce na punkt gastronomiczny oraz na wypożyczalnię sprzętu sportowego.</p><p>Nowa placówka i przestrzeń dookoła niej stały się miejscem spotkań z kulturą, koncertów plenerowych, wydarzeń ekologicznych i oświatowych, zawodów rekreacyjnych i sportowych.",
